class CreateLoadbalanceRequest(TeaModel):
    def __init__(
        self,
        auth_token: str = None,
        address_type: str = None,
        app_id: str = None,
        app_service_id: str = None,
        cluster_mode: bool = None,
        instance_count: int = None,
        internet_charge_type: str = None,
        listeners: List[str] = None,
        name: str = None,
        share_mode: bool = None,
        vip_type: str = None,
        v_switch_id: str = None,
        workspace: str = None,
        workspace_id: str = None,
        zone_id: str = None,
        load_balancer_spec: str = None,
    ):
        # OAuth模式下的授权token
        self.auth_token = auth_token
        # 负载均衡实例的网络类型。有 INTERNET 和 INTRANET
        self.address_type = address_type
        # app id
        self.app_id = app_id
        # app service id
        self.app_service_id = app_service_id
        # cluster_mode
        self.cluster_mode = cluster_mode
        # 
        # 创建的实例数量。默认为 1 台
        self.instance_count = instance_count
        # 公网类型实例的付费方式。取值：
        # PAY_BY_BANDWIDTH：按带宽计费。
        # PAY_BY_TRAFFIC：按流量计费（默认值）。
        self.internet_charge_type = internet_charge_type
        # listener JSON Array
        self.listeners = listeners
        # 名称
        self.name = name
        # 共享模式
        self.share_mode = share_mode
        # ALB模式专用
        self.vip_type = vip_type
        # VPC类型的实例，需要指定虚拟交换机ID。
        self.v_switch_id = v_switch_id
        # 工作空间
        self.workspace = workspace
        # workspace_id
        self.workspace_id = workspace_id
        # 可用区
        self.zone_id = zone_id
        # 负载均衡实例的规格。取值：
        # 
        # slb.s1.small
        # slb.s2.small
        # slb.s2.medium
